function App() {
  return (
    <div className="App">
      <HeaderComponent></HeaderComponent>
      <ButtonComponent>
      id={id}
      className={`button-container button-container-${type} button-container-size-${size}`}
      style={{ borderRadius: borderRadius + 'px' }}
      color="primary"
      variant="contained"
      onClick={onClick}
      fullWidth={fullWidth}
      </ButtonComponent>

    </div>
  );
}

export default App;
